import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Authenticator, AmplifyAuthenticator, AmplifySignUp, AmplifySignIn, AmplifySignOut} from '@aws-amplify/ui-react';
import MySignUp from './components/LoginContainer/MySignUp';

function App() {
  return (
    <Authenticator hideDefault={true}>
      <MySignUp/>
    </Authenticator>
  );
}

export default App;
